import React from 'react';
import ReactDOM from 'react-dom';
import { Container } from '@material-ui/core';
import Form from './components/signUp';
import Navbar from './components/navbar';

ReactDOM.render(
    <div>
        <Navbar/>
        <Container>

            <Form/>
        </Container>
    </div>, 
    document.getElementById('root'));
